import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 80%;
  height: auto;
  margin-left: auto;
  margin-right: auto;
`;

const Footer = () => {
  return (
    <Container>
      <div className="header"></div>
    </Container>
  );
};

export default Footer;
